    const [phone, setphone] = useState("")
    useEffect(() => {
        onLoad(match.params.fleetId);
      }, []);
      const onLoad = (fleetId) =>{
        loadeditFleets(fleetId).then(res => {
            console.log(res);
            setcode(res.fid)
            setname(res.name)
            setphone(res.phone)
        })
        .catch(err => {
            console.log(err)
        })
      }
